import React, { useEffect, useRef, useState } from 'react';
import { gsapAnimations, animeAnimations } from '../utils/animations';

const AnimationDemo = () => {
  const [isVisible, setIsVisible] = useState(false);
  const demoRef = useRef(null);
  const cardsRef = useRef([]);
  const counterRef = useRef(null);

  useEffect(() => {
    if (demoRef.current && isVisible) {
      // Entrance animation
      gsapAnimations.pageLoad(demoRef.current.children);
      
      // Counter animation
      if (counterRef.current) {
        animeAnimations.counter(counterRef.current, 100);
      }

      // Floating cards
      setTimeout(() => {
        animeAnimations.floatingElements('.demo-card');
      }, 1000);
    }
  }, [isVisible]);

  const handleShowDemo = () => {
    setIsVisible(true);
  };

  const handleCardClick = (index) => {
    if (cardsRef.current[index]) {
      animeAnimations.cardFlip(cardsRef.current[index]);
    }
  };

  const styles = {
    container: {
      padding: '2rem',
      maxWidth: '800px',
      margin: '0 auto',
      textAlign: 'center',
    },
    title: {
      fontSize: '2.5rem',
      fontWeight: 'bold',
      background: 'linear-gradient(135deg, #667eea, #764ba2)',
      WebkitBackgroundClip: 'text',
      WebkitTextFillColor: 'transparent',
      marginBottom: '2rem',
    },
    demoButton: {
      padding: '1rem 2rem',
      background: 'linear-gradient(135deg, #667eea, #764ba2)',
      color: 'white',
      border: 'none',
      borderRadius: '25px',
      fontSize: '1.1rem',
      fontWeight: '600',
      cursor: 'pointer',
      transition: 'all 0.3s ease',
      marginBottom: '2rem',
    },
    cardsContainer: {
      display: 'grid',
      gridTemplateColumns: 'repeat(auto-fit, minmax(200px, 1fr))',
      gap: '1.5rem',
      marginTop: '2rem',
    },
    card: {
      background: 'rgba(255, 255, 255, 0.95)',
      backdropFilter: 'blur(10px)',
      borderRadius: '16px',
      padding: '1.5rem',
      boxShadow: '0 8px 32px rgba(0, 0, 0, 0.1)',
      border: '1px solid rgba(255, 255, 255, 0.2)',
      cursor: 'pointer',
      transition: 'all 0.3s ease',
    },
    cardTitle: {
      fontSize: '1.2rem',
      fontWeight: '600',
      color: '#333',
      marginBottom: '0.5rem',
    },
    cardDescription: {
      color: '#666',
      fontSize: '0.9rem',
    },
    counter: {
      fontSize: '3rem',
      fontWeight: 'bold',
      color: '#667eea',
      margin: '1rem 0',
    },
    features: {
      marginTop: '2rem',
      textAlign: 'left',
    },
    featureItem: {
      padding: '1rem',
      margin: '0.5rem 0',
      background: 'rgba(255, 255, 255, 0.9)',
      borderRadius: '12px',
      borderLeft: '4px solid #667eea',
    }
  };

  return (
    <div style={styles.container}>
      <h2 style={styles.title}>ðŸŽ¨ Animation Showcase</h2>
      
      {!isVisible ? (
        <button style={styles.demoButton} onClick={handleShowDemo}>
          Show Animation Demo
        </button>
      ) : (
        <div ref={demoRef}>
          <div style={styles.counter} ref={counterRef}>0</div>
          <p>âœ¨ Tasks Animated Successfully!</p>

          <div style={styles.cardsContainer}>
            {[
              { title: 'GSAP Animations', desc: 'Smooth task transitions' },
              { title: 'Anime.js Effects', desc: 'Beautiful floating elements' },
              { title: 'Modern Design', desc: 'Glassmorphism UI' },
              { title: 'Interactive', desc: 'Click to see flip animation' }
            ].map((item, index) => (
              <div
                key={index}
                ref={el => cardsRef.current[index] = el}
                style={styles.card}
                className="demo-card"
                onClick={() => handleCardClick(index)}
              >
                <div style={styles.cardTitle}>{item.title}</div>
                <div style={styles.cardDescription}>{item.desc}</div>
              </div>
            ))}
          </div>

          <div style={styles.features}>
            <div style={styles.featureItem}>
              <strong>ðŸš€ GSAP Features:</strong> Page load animations, task enter/exit effects, button hover animations, error shake effects
            </div>
            <div style={styles.featureItem}>
              <strong>âœ¨ Anime.js Features:</strong> Floating elements, particle systems, counter animations, wave effects
            </div>
            <div style={styles.featureItem}>
              <strong>ðŸŽ¯ Combined Effects:</strong> Task completion celebrations, loading sequences, scroll-triggered animations
            </div>
          </div>
        </div>
      )}
    </div>
  );
};

export default AnimationDemo;
